import React , { Component } from 'react';
import { Doughnut } from 'react-chartjs-2';

class DevicesData extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ChartData: {
                labels: ['Desktop', 'Teblet', 'Mobile'],
                datasets: [
                    {
                        label: 'Population',
                        data: [
                            461759,
                            181045,
                            457878
                        ],
                        backgroundColor: [
                            '#ce2e2e',
                            '#f11ac2ba',
                            'skyblue',
                            
                        ]
                    }
                ]
            }
        }
    }

    render() {
        return (
            <div className="Chart-Bar">
                <Doughnut
                    data={this.state.ChartData}
                    options={{
                        maintainAspectRatio: false,
                        rotation: 1 * Math.PI,

                    }}
                />
            </div>
        )
    }
} 
export default DevicesData;
